import React, { Component } from 'react';
import '../styles.css';
class List extends Component{
    constructor(props){
        super(props);
        this.state = {
            list : []
        }
    }

    componentDidMount(){
        this.getList();
    }

    getList = () => {
        fetch('http://localhost:4006/')
        .then(res =>res.json())
        .then(list => this.setState({list}))

    }

    render(){

        const {list} = this.state;

        return (
            <div >
              <h1 >List of Items</h1>

              <table>
                <tr>
                    <th>ProjectId</th>
                    <th>Department</th>
                    <th>Metername</th>
                    <th>Meter Description</th>
                    <th>Meter Reading</th>
                    <th>Reading Date</th>
                </tr>
                {list.length ? (
                  <tr>
                    {list.map ((item)=> {
                      return (
                        <div>
                          <td>{item.a_projectid}</td>
                          <td>{item.a_dept} </td>
                          <td>{item.a_metername} </td>
                          <td>{item.a_meterdesc} </td>
                          <td>{item.a_meterreading} </td>
                          <td>{item.a_readdate} </td>
                        </div>
                      )
                    })}
                  </tr>
                ):(<div>
                  Laoding...
                </div>) }

      
                 
                
              </table>              
            </div>
          );

        }
            
}

export default List;
